import PantryItemNotInStock from "./PantryItemNotInStock";


function PantryCategory() {
    return (
        <section className={cat.toLowerCase() + "-section pantry-category"}>
            <PantryCategoryHeader />
            <PantryItemAddBar />
            {enteredItems[0]["items"].map((item) => (
                (item.category === cat && cat !== "Saved Items" && item.inStock) ? <PantryItemInStock />
                : (cat === "Saved Items" && !item.inStock) ? <PantryItemNotInStock />
                : null
            ))}
        </section>
    );
}

export default PantryCategory
